import React, { useState } from "react";
import Style from "./home.module.scss";
import Cards from "../cards";
import Burger from "../menuBurger";
import Aside from "../aside";
import veiculos from "./veiculos.json"

function Home() {
  const setVeiculos = new Set();
  const DadosCheckbox = veiculos.filter((veiculo) => {
    const MarcaDuplicada = setVeiculos.has(veiculo.marca);
    setVeiculos.add(veiculo.marca);
    return !MarcaDuplicada;
  });

  return (
    <>
      <Burger />
      <div className={Style.container}>
        <div className={Style.filtro}>
          {DadosCheckbox.map((veiculo) => (
            <Aside marca={veiculo.marca} />
          ))}
        </div>
        <div className={Style.container__conteudo}>
          {veiculos.map((veiculo) => (
            <Cards
              key={veiculo.nome}
              nome={veiculo.nome}
              ano={veiculo.ano}
              imagem={veiculo.imagem}
              valor={veiculo.valor}
            />
          ))}
        </div>
      </div>
    </>
  );
}
export default Home;
